<script type="module">
  import { parseColorHexRGB } from "https://cdn.holoviz.org/panel/0.14.0/dist/bundled/js/@microsoft/fast-colors@5.3.1/dist/index.js";
  import {
    createColorPalette,
    accentFillActiveBehavior,
    accentFillHoverBehavior,
    accentFillRestBehavior,
    accentForegroundActiveBehavior,
    accentForegroundCutRestBehavior,
    accentForegroundFocusBehavior,
    accentForegroundHoverBehavior,
    accentForegroundRestBehavior,
    neutralDividerRestBehavior,
    neutralFillHoverBehavior,
    neutralFillInputActiveBehavior,
    neutralFillInputHoverBehavior,
    neutralFillInputRestBehavior,
    neutralFillRestBehavior,
    neutralFillStealthActiveBehavior,
    neutralFillStealthHoverBehavior,
    neutralFillStealthRestBehavior,
    neutralFocusBehavior,
    neutralFocusInnerAccentBehavior,
    neutralForegroundActiveBehavior,
    neutralForegroundHoverBehavior,
    neutralLayerFloatingBehavior,
    neutralOutlineActiveBehavior,
    neutralOutlineHoverBehavior,
    neutralOutlineRestBehavior
  } from "https://cdn.holoviz.org/panel/0.14.0/dist/bundled/js/@microsoft/fast-components@1.21.8/dist/fast-components.js";

  function standardize_color(str){
    var ctx = document.createElement('canvas').getContext('2d');
    ctx.fillStyle = str;
    return ctx.fillStyle;
  }

  function setAccentColor(color, selector){
      color = standardize_color(color);
      const accent = color;
      const palette = createColorPalette(parseColorHexRGB(accent));
      const provider = document.querySelector(selector);
      provider.accentBaseColor = accent;
      provider.accentPalette = palette;
  }
  setAccentColor("#0072B5", "#body-design-provider");
  setAccentColor("#ffffff", "#header-design-provider");

  function setNeutralColor(color, selector){
      color = standardize_color(color);
      const palette = createColorPalette(parseColorHexRGB(color));
      const provider = document.querySelector(selector);

      provider.neutralPalette = palette;
  }
  setNeutralColor("#ffffff", "#header-design-provider");
  setNeutralColor("#000000", "#body-design-provider");

  function setBackgroundColor(color, selector){
    color = standardize_color(color);
    const provider = document.querySelector(selector);
    provider.backgroundColor=color;
  }
  setBackgroundColor("#0072B5", "#header-design-provider");
  setBackgroundColor("#ffffff", "#body-design-provider");

  document.querySelector("#body-design-provider").cornerRadius=3;

  function registerCSSCustomProperties(selector)  {
    const provider = document.querySelector(selector);
    provider.registerCSSCustomProperty(accentFillActiveBehavior)
    provider.registerCSSCustomProperty(neutralFillRestBehavior)
    provider.registerCSSCustomProperty(accentFillHoverBehavior)
    provider.registerCSSCustomProperty(accentFillRestBehavior)
    provider.registerCSSCustomProperty(accentForegroundActiveBehavior)
    provider.registerCSSCustomProperty(accentForegroundCutRestBehavior)
    provider.registerCSSCustomProperty(accentForegroundFocusBehavior)
    provider.registerCSSCustomProperty(accentForegroundHoverBehavior)
    provider.registerCSSCustomProperty(accentForegroundRestBehavior)
    provider.registerCSSCustomProperty(neutralDividerRestBehavior)
    provider.registerCSSCustomProperty(neutralFillHoverBehavior)
    provider.registerCSSCustomProperty(neutralFillInputActiveBehavior)
    provider.registerCSSCustomProperty(neutralFillInputHoverBehavior)
    provider.registerCSSCustomProperty(neutralFillInputRestBehavior)
    provider.registerCSSCustomProperty(neutralFillRestBehavior)
    provider.registerCSSCustomProperty(neutralFillStealthActiveBehavior)
    provider.registerCSSCustomProperty(neutralFillStealthHoverBehavior)
    provider.registerCSSCustomProperty(neutralFillStealthRestBehavior)
    provider.registerCSSCustomProperty(neutralFocusBehavior)
    provider.registerCSSCustomProperty(neutralFocusInnerAccentBehavior)
    provider.registerCSSCustomProperty(neutralForegroundActiveBehavior)
    provider.registerCSSCustomProperty(neutralForegroundHoverBehavior)
    provider.registerCSSCustomProperty(neutralLayerFloatingBehavior)
    provider.registerCSSCustomProperty(neutralOutlineActiveBehavior)
    provider.registerCSSCustomProperty(neutralOutlineHoverBehavior)
    provider.registerCSSCustomProperty(neutralOutlineRestBehavior)
  }
  registerCSSCustomProperties("#header-design-provider")
  registerCSSCustomProperties("#body-design-provider")

  class FastDesignProvider {
    setAccentColor(value, element){
      setAccentColor(value, element);
    }
    setNeutralColor(value, element){
      setNeutralColor(value, element);
    }
    setBackgroundColor(value, element){
      setBackgroundColor(value, element)
    }
  }
  window.fastDesignProvider = new FastDesignProvider()
</script>

<script>
  function openNav() {
    document.getElementById("sidebar").style.left = 0;
    document.getElementById("main").style.marginLeft = "360px";
    document.getElementById("sidebar-button").onclick = closeNav;
    var interval = setInterval(function () { window.dispatchEvent(new Event('resize')); }, 10);
    setTimeout(function () { clearInterval(interval) }, 210)
  }

  function closeNav() {
    document.getElementById("sidebar").style.left = "-360px";
    document.getElementById("main").style.marginLeft = 0;
    document.getElementById("sidebar-button").onclick = openNav;
    var interval = setInterval(function () { window.dispatchEvent(new Event('resize')); }, 10);
    setTimeout(function () { clearInterval(interval) }, 210)
  }

  var modal = document.getElementById("pn-Modal");
  var span = document.getElementById("pn-closeModal");

  span.onclick = function() {
    modal.style.display = "none";
  }

  window.onclick = function(event) {
    if (event.target == modal) {
      modal.style.display = "none";
    }
  }
</script>

    <script type="text/javascript">
      const pyodideWorker = new Worker("./script.js");
      pyodideWorker.busy = false
      pyodideWorker.queue = []
      
      function send_change(jsdoc, event) {
        if (event.setter_id != null && event.setter_id == 'py') {
          return
        } else if (pyodideWorker.busy && event.model && event.attr) {
          let events = []
          for (const old_event of pyodideWorker.queue) {
            if (!(old_event.model === event.model && old_event.attr === event.attr)) {
              events.push(old_event)
            }
          }
          events.push(event)
          pyodideWorker.queue = events
          return
        }
        const patch = jsdoc.create_json_patch_string([event])
        pyodideWorker.busy = true
        pyodideWorker.postMessage({type: 'patch', patch: patch})
      }
      
      pyodideWorker.onmessage = async (event) => {
        const msg = event.data
      
        const body = document.getElementsByTagName('body')[0]
        const loading_msgs = document.getElementsByClassName('pn-loading-msg')
        if (msg.type === 'idle') {
          if (pyodideWorker.queue.length) {
            const patch = pyodideWorker.jsdoc.create_json_patch_string(pyodideWorker.queue)
            pyodideWorker.busy = true
            pyodideWorker.queue = []
            pyodideWorker.postMessage({type: 'patch', patch: patch})
          } else {
            pyodideWorker.busy = false
          }
        } else if (msg.type === 'status') {
          let loading_msg
          if (loading_msgs.length) {
            loading_msg = loading_msgs[0]
          } else if (body.classList.contains('pn-loading')) {
            loading_msg = document.createElement('div')
            loading_msg.classList.add('pn-loading-msg')
            body.appendChild(loading_msg)
          }
          if (loading_msg != null) {
            loading_msg.innerHTML = msg.msg
          }
        } else if (msg.type === 'render') {
          const docs_json = JSON.parse(msg.docs_json)
          const render_items = JSON.parse(msg.render_items)
          const root_ids = JSON.parse(msg.root_ids)
      
          // Remap roots in message to element IDs
          const root_els = document.getElementsByClassName('bk-root')
          const data_roots = []
          for (const el of root_els) {
             el.innerHTML = ''
             data_roots.push([parseInt(el.getAttribute('data-root-id')), el.id])
          }
          data_roots.sort((a, b) => a[0]<b[0] ? -1: 1)
          const roots = {}
          for (let i=0; i<data_roots.length; i++) {
            roots[root_ids[i]] = data_roots[i][1]
          }
          render_items[0]['roots'] = roots
          render_items[0]['root_ids'] = root_ids
      
          // Embed content
          const [views] = await Bokeh.embed.embed_items(docs_json, render_items)
      
          // Remove loading spinner and message
          body.classList.remove("bk", "pn-loading", "arc")
          for (const loading_msg of loading_msgs) {
            loading_msg.remove()
          }
      
          // Setup bi-directional syncing
          pyodideWorker.jsdoc = jsdoc = views[0].model.document
          jsdoc.on_change(send_change.bind(null, jsdoc), false)
          pyodideWorker.postMessage({'type': 'rendered'})
          pyodideWorker.postMessage({'type': 'location', location: JSON.stringify(window.location)})
        } else if (msg.type === 'patch') {
          pyodideWorker.jsdoc.apply_json_patch(JSON.parse(msg.patch), msg.buffers, setter_id='py')
        }
      };

","line_width":2,"x":{"field":"Provider State Sorted"},"y":{"field":"Average Total Payments"}},"id":"1227","type":"Line"},{"attributes":{"children":[{"id":"1285"},{"id":"1343"},{"id":"1438"}],"margin":[0,0,0,0],"min_width":2000,"name":"Row01607","width":2000},"id":"1281","type":"Row"},{"attributes":{"children":[{"id":"1026"}],"margin":[0,0,0,0],"name":"Row01579"},"id":"1022","type":"Row"},{"attributes":{"css_classes":["markdown"],"margin":[5,5,5,5],"name":"Markdown01550","text":"&amp;lt;h2&amp;gt;10 Time-Series Python Libraries in 2022:&amp;lt;/h2&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Flow forecast&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Flow forecast is a deep learning for time series forecasting framework. It provides the latest models (transformers, attention models, GRUs) and cutting edge concepts with interpretability metrics. It is the only true end-to-end deep learning for time series forecasting framework.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Auto_TS&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Auto_TS train multiple time series models with just one line of code and is a part of autoML.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda SKTIME&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Sktime an extension to scikit-learn includes machine learning time-series for regression, prediction, and classification. This library has the most features with interfaces scikit-learn, statsmodels, TSFresh and PyOD.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Darts&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Darts contains a large number of models ranging from ARIMA to deep neural networks. It also lets users combine predictions from several models and external regressors which makes it easier to backtest models.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Pmdarima&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Pmdarima is a wrapper over ARIMA with automatic Hyperparameter tunning for analyzing, forecasting, and visualizing time series data including transformers and featurizers, including Box-Cox and Fourier transformations and a seasonal decomposition tool.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda TSFresh&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;TSFresh automates feature extraction and selection from time series. It has Dimensionality reduction, Outlier detection and missing values.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Pyflux&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Pyflux builds probabilistic model, very advantageous for tasks where a more complete picture of uncertainty is needed and the latent variables are treated as random variables through a joint probability.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Prophet&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;Facebook&amp;amp;rsquo;s Prophet is a forecasting tool for CSV format and is suitable for strong seasonal data and robust to missing data and outliers.\nProphet is a library that makes it easy for you to fit a model that decomposes a time series model into trend, season, and holiday components. It&amp;amp;rsquo;s somewhat customizable and has a few nifty tools like graphing and well-thought out forecasting.\nProphet does the following linear decomposition:&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;g(t): Logistic or linear growth trend with optional linear splines (linear in the exponent for the logistic growth). The library calls the knots &amp;amp;lsquo;change points.&amp;amp;rsquo;&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;s(t): Sine and cosine (i.e. Fourier series) for seasonal terms.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;h(t): Gaussian functions (bell curves) for holiday effects (instead of dummies, to make the effect smoother).&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://www.reddit.com/r/MachineLearning/comments/syx41w/p_beware_of_false_fbprophets_introducing_the/&amp;quot;&amp;gt;Some thoughts about Prophet&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda Statsforecast&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://github.com/Nixtla/statsforecast&amp;quot;&amp;gt;GitHub Link to Statsforecast&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Statsforecast offers a collection of univariate time series. It invludes ADIDA, HistoricAverage, CrostonClassic, CrostonSBA, CrostonOptimized, SeasonalNaive, IMAPA Naive, RandomWalkWithDrift, TSB, AutoARIMA and ETS.\nImpressive fact: It is 20x faster than pmdarima , 500x faster than Prophet,100x faster than NeuralProphet, 4x faster than statsmodels. &amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda PyCaret&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;PyCaret replaces hundreds of lines of code with few lines only. Its time-series forecasting is in pre-release mode with &amp;amp;ndash;pre tag with 30+ algorithms. It includes automated hyperparameter tuning, experiment logging and deployment on cloud.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;\ud83d\udcda NeuralProphet&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;NeuralProphet is a Neural Network based Time-Series model, inspired by Facebook Prophet and AR-Net, built on PyTorch.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Source: Maryam Miradi, PhD &amp;lt;/p&amp;gt;","width":800},"id":"1552","type":"panel.models.markup.HTML"},{"attributes":{},"id":"1232","type":"BasicTickFormatter"},{"attributes":{"children":[{"id":"1596"},{"id":"1597"}],"margin":[0,0,0,0],"name":"Row01666"},"id":"1595","type":"Row"},{"attributes":{},"id":"1056","type":"Selection"},{"attributes":{"end":36,"margin":[5,10,5,10],"start":1,"value":1},"id":"1546","type":"Slider"},{"attributes":{"coordinates":null,"group":null,"text_color":"#2B2B2B","text_font":"Open Sans, sans-serif","text_font_size":"1.15em"},"id":"1344","type":"Title"},{"attributes":{"css_classes":["markdown"],"margin":[5,5,5,5],"name":"Markdown01496","text":"&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://firobeid.github.io/compose-plots/Resources/binning_V1.html&amp;quot;&amp;gt;DataViz HTMLS Deployments&amp;lt;/a&amp;gt;&amp;lt;/p&am ","PA","IL","TX","FL","NY","CA"]},"selected":{"id":"1380"},"selection_policy":{"id":"1394"}},"id":"1379","type":"ColumnDataSource"},{"attributes":{"css_classes":["markdown"],"margin":[0,10,0,10],"name":"Markdown01566","text":"&amp;lt;h1&amp;gt;Prediction Submission&amp;lt;/h1&amp;gt;\n&amp;lt;p&amp;gt;This section is to host a time series modelling competition between UCBekely students teams&amp;amp;rsquo;. The teams should\nbuild a time series univariate or multivariate model but the aim is to forcast the &amp;lt;code&amp;gt;GHI&amp;lt;/code&amp;gt; column (a solar energy storage metric).&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;The train data is 30 minutes frequecy data between 2010-2017 for solar energy for UTDallas area. The students then predict the whole off 2018\n,which is 17519 data points (periods) into the future (2018).&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;The data used for the modelling can be found here: \n&amp;lt;a href=&amp;quot;https://github.com/firobeid/Forecasting-techniques/tree/master/train_data&amp;quot;&amp;gt;Competition Data&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;Instructions&amp;lt;/h3&amp;gt;\n&amp;lt;ol&amp;gt;\n&amp;lt;li&amp;gt;Upload predictions CSV (only numerical data)&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Make sure you have 17519 predictions / row in your CSV&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Press &amp;lt;code&amp;gt;Click to get model error/score!&amp;lt;/code&amp;gt;&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Observe you predictions error to the right ==&amp;amp;gt;&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;"},"id":"1566","type":"panel.models.markup.HTML"},{"attributes":{"children":[{"id":"1548"}],"margin":[0,0,0,0],"name":"Row01625"},"id":"1547","type":"Row"},{"attributes":{"children":[{"id":"1554"},{"id":"1555"}],"margin":[0,0,0,0],"name":"Column01632"},"id":"1553","type":"Column"},{"attributes":{"margin":[5,5,5,5],"paused":true,"value":"http://ccrma.stanford.edu/~jos/mp3/pno-cs.mp3"},"id":"1597","type":"panel.models.widg
